import React from 'react'
import Paper from "@mui/material/Paper";
import Box from "@mui/material/Box";
import Stack from "@mui/material/Stack";
import { Typography } from '@mui/material';
import headshot from "../headshot.JPG";
import folder from "../images/folder.png";

export default function Education() {
  return (
    <div>
      <Stack direction="row" spacing={2} sx={{ height: "500px", ml: 2 }}>
            <div className="list">
              <Box
                sx={{
                  bgcolor: "#b5b5b5",
                  borderRadius: 2,
                  height: 250,
                }}
              >
                <div class="container">
                  <div class="circle1"></div>
                  <div class="circle2"></div>
                  <div class="circle3"></div>
                </div>
                <Paper
                  elevation={3}
                  sx={{
                    bgcolor: "white",
                    borderRadius: 1,
                    width: 500,
                    height: 500,
                    fontSize: 24,
                  }}
                >
                  <br />

                  <Typography variant="h2"> Profile </Typography>
                  <br/>

                  <img src={headshot} alt="headshot" width={265.3} height={310.8}/>

                </Paper>
              </Box>
            </div>

            <div className="second box">
              <Box
                sx={{
                  bgcolor: "#b5b5b5",
                  borderRadius: 2,
                  height: 250,
                }}
              >
                <div class="container">
                  <div class="circle1"></div>
                  <div class="circle2"></div>
                  <div class="circle3"></div>
                </div>
                <Paper
                  elevation={3}
                  sx={{
                    bgcolor: "white",
                    borderRadius: 1,
                    width: 800,
                    height: 500,
                    fontSize: 24,
                  }}
                >
                  <br />
                  <Typography variant="h2"> Education </Typography>
                  <Typography variant="p">
                    Purdue University, Bachelor of Science in Data Science{" "}
                  </Typography>
                </Paper>
              </Box>
            </div>

            <Stack spacing={2} sx={{ height: "500px", ml: 2 }}>
            <img src={folder} alt="folder" width={200} height={130}/>
            <br/>
            <img src={folder} alt="folder" width={200} height={130}/>
            <img src={folder} alt="folder" width={200} height={130}/>

            </Stack>


      </Stack>

    </div>
  )
}
